<script>
import gsap from "gsap";
import { mapState } from "vuex";
import { MotionPathPlugin } from "gsap/MotionPathPlugin";
import { DrawSVGPlugin } from "gsap/DrawSVGPlugin";
gsap.registerPlugin(MotionPathPlugin, DrawSVGPlugin);

export default {
  name: "MapComponent",
  computed: {
    ...mapState(["distance"]),
  },
  mounted() {
    console.log("map mounted");
    this.setTimelines();
    this.update(this.distance);
    this.reset();
  },
  methods: {
    reset() {
      this.$store.subscribe((mutation) => {
        if (mutation.type == "reset") this.update(0);
      });
    },
    update(val) {
      this.followTl.progress(val / 100);
      this.bubbleTl.progress(val / 100);
    },
    setTimelines() {
      gsap
        .timeline({ repeat: -1, yoyo: true })
        .fromTo(
          this.$refs.grow,
          { scale: 0, transformOrigin: "center center" },
          { scale: 1, duration: 1 }
        );
      this.followTl = gsap.timeline({ paused: true }).fromTo(
        this.$refs.draw,
        {
          drawSVG: "0% 0%",
        },
        {
          drawSVG: "0% 100%",
          ease: "none",
          duration: 1,
        }
      );

      this.bubbleTl = gsap
        .timeline({ paused: true })
        .to(this.$refs.group, {
          motionPath: {
            path: this.$refs.follow,
            autoRotate: false,
            align: this.$refs.follow,
            alignOrigin: [0, 1],
            start: 0,
            end: 1,
          },
          transformOrigin: "0% 100%",
          ease: "none",
          duration: 1,
        })
        .to(
          this.$refs.bubble,
          {
            motionPath: {
              path: this.$refs.path,
              autoRotate: false,
              align: this.$refs.path,
              alignOrigin: [0.5, 0.5],
              start: 0,
              end: 1,
            },
            transformOrigin: "center",
            ease: "none",
            duration: 0.991,
          },
          "<"
        );
    },
  },
};
</script>

